import React from "react";
import {Link} from 'react-router-dom'

const Headlines = props => {
  let newsList = props.nytData.results.map(article => {
    return <li>
        <Link to={"/article/"+article.title}>{article.title}</Link>
        </li>;
  });

  return (
    <div>
      <ul>{newsList}</ul>
    </div>
  );
};

export default Headlines;
